  const columns = [
  { field: 'id', headerName: 'ID', width: 70 },
  { field: 'user', headerName: 'User', width: 200, 
  renderCell: (params) => {
    return(
      <div className="orderListUser">
        {params.row.username}
      </div>
      );
  }
},
  { field: 'email', headerName: 'email', width: 200 },
  {
    field: 'status',
    headerName: 'Status',
    width: 150,
  },
  {
    field: 'transaction',
    headerName: 'Transaction',
    width: 150,
   },
   {
    field: 'action',
    headerName: 'Action',
    width: 150,
    renderCell: (params) => {
      return(
        <>
          <button className="orderListEdit">Edit</button>
          <DeleteSharpIcon className="orderListDelete"/>
        </>
        );
    }
   },

];

const rows = [
  { id: 1, username: 'Snow Jon',
